import React, { useState, useCallback } from 'react';
import { Menu } from 'antd';
import {
	AppstoreAddOutlined,
	SaveOutlined,
	LineChartOutlined,
} from '@ant-design/icons';
// const { SubMenu } = Menu;
import Link from 'next/link';
import { useDispatch, useSelector } from 'react-redux';
import { SELECT_MENU_REQUEST } from '../../actions';

const AppMenu = () => {
	const dispatch = useDispatch();
	const { selecedMenu } = useSelector(state => state.post);
	const handleClick = useCallback(e => {
		// e.preventDefault();
		console.log(selectedMenu);
		dispatch({
			type: SELECT_MENU_REQUEST,
			data: e.key,
		});
	}, []);
	return (
		<Menu onClick={handleClick} selectedKeys={[selecedMenu]} mode="horizontal">
			<Menu.Item key="overview" icon={<AppstoreAddOutlined />}>
				<Link href="/main">
					<a>Overview</a>
				</Link>
			</Menu.Item>
			<Menu.Item key="repo" icon={<SaveOutlined />}>
				<Link href="/repository">
					<a>repositories</a>
				</Link>
			</Menu.Item>
			<Menu.Item key="statistics" icon={<LineChartOutlined />}>
				Statistics
			</Menu.Item>
			{/* <Menu.Item key="alipay">
				<a href="https://ant.design" target="_blank" rel="noopener noreferrer">
					Navigation Four - Link
				</a>
			</Menu.Item> */}
		</Menu>
	);
};

export default AppMenu;
